import Card from './Card';

export default function Cards(props) {
   const {characters} = props;
   return <>
      {
         characters.map((el, index)=> <Card 
         key = {index}
         name = {el.name}
         species = {el.species}
         gender = {el.gender}
         image = {el.image}
         onClose = {()=>alert("Emulamos que se cierra la card")}
         />)
      }
      
   </>;
}
